import React, {Fragment} from 'react'
import { Button } from '@mui/material';
import SettingsIcon from '@mui/icons-material/Settings';
import NotStartedOutlinedIcon from '@mui/icons-material/NotStartedOutlined';
import StopCircleOutlinedIcon from '@mui/icons-material/StopCircleOutlined';
import RestartAltOutlinedIcon from '@mui/icons-material/RestartAltOutlined';
import AddCircleOutlineOutlinedIcon from '@mui/icons-material/AddCircleOutlineOutlined';
import RemoveCircleOutlineOutlinedIcon from '@mui/icons-material/RemoveCircleOutlineOutlined';
import SaveAltOutlinedIcon from '@mui/icons-material/SaveAltOutlined';

function Buttons(props) {

  return (
    <div className='Buttons'> 

      {(props.status === 0 || props.status === 3) ?
          <Button variant="contained" sx={{color: '#fff', backgroundColor: '#552DC6'}} onClick={props.start}><NotStartedOutlinedIcon sx={{ fontSize: 50 , color: 'white', marginRight: 2 }}/>Start</Button> : ""
      }

      {(props.status === 0) ?
        <Fragment>
          <SettingsIcon onClick={props.configTimer} 
            sx={
                {fontSize: 45,
                color: '#fff',
                backgroundColor:'#552DC6',
                cursor: 'pointer',
                marginLeft: 2,
                border: 1,
                borderRadius: 1,
                borderColor: '#552DC6'}
            }></SettingsIcon>
        </Fragment> : "" }

      {(props.status === 1) ?
      <Fragment>
          <StopCircleOutlinedIcon sx={
                {fontSize: 45,
                color: '#fff',
                backgroundColor:'#552DC6',
                cursor: 'pointer',
                marginLeft: 2,
                border: 1,
                borderRadius: 1,
                borderColor: '#552DC6'}
            } onClick={props.stop}/>
          <RestartAltOutlinedIcon sx={
                {fontSize: 45,
                color: '#fff',
                backgroundColor:'#552DC6',
                cursor: 'pointer',
                marginLeft: 2,
                border: 1,
                borderRadius: 1,
                borderColor: '#552DC6'}
            }  onClick={props.reset}/>
          <Button variant="contained" onClick={props.goToBreak}>Go to Break</Button> 
      </Fragment> : "" }

      {(props.status === 2) ?
      <Fragment>
          <Button variant="contained" onClick={props.resume}>Resume</Button>
          <RestartAltOutlinedIcon sx={
                {fontSize: 45,
                color: '#fff',
                backgroundColor:'#552DC6',
                cursor: 'pointer',
                marginLeft: 2,
                border: 1,
                borderRadius: 1,
                borderColor: '#552DC6'}
            }  onClick={props.reset}/>
          <Button variant="contained" onClick={props.goToBreak}>Go to Break</Button> 
      </Fragment> : "" }

      {(props.status === 4) ?
      <Fragment>
          <Button variant="contained" onClick={props.backToStudy}>Back to Study</Button>
      </Fragment> : "" }

      {(props.status === 5) ?
      <Fragment>
          <AddCircleOutlineOutlinedIcon sx={
                {fontSize: 45,
                color: '#fff',
                backgroundColor:'#552DC6',
                cursor: 'pointer',
                marginLeft: 2,
                border: 1,
                borderRadius: 1,
                borderColor: '#552DC6'}
            } onClick={props.addTimer}/>
          <RemoveCircleOutlineOutlinedIcon sx={
                {fontSize: 45,
                color: '#fff',
                backgroundColor:'#552DC6',
                cursor: 'pointer',
                marginLeft: 2,
                border: 1,
                borderRadius: 1,
                borderColor: '#552DC6'}
            } onClick={props.subTimer}/>
          <SaveAltOutlinedIcon sx={
                {fontSize: 45,
                color: '#fff',
                backgroundColor:'#552DC6',
                cursor: 'pointer',
                marginLeft: 2,
                border: 1,
                borderRadius: 1,
                borderColor: '#552DC6'}
            }onClick={props.goToConfigBreak}/>
      </Fragment> : "" }

      {(props.status === 6) ?
      <Fragment>
          <NotStartedOutlinedIcon sx={{ fontSize: 50 , color: 'white', marginRight: 2 }} onClick={props.breakRun}/>
          <Button variant="contained" onClick={props.backToStudy}>Back to Study</Button>
      </Fragment> : "" }

      {(props.status === 7) ?
      <Fragment>
          <StopCircleOutlinedIcon sx={
                {fontSize: 45,
                color: '#fff',
                backgroundColor:'#552DC6',
                cursor: 'pointer',
                marginLeft: 2,
                border: 1,
                borderRadius: 1,
                borderColor: '#552DC6'}
            } onClick={props.stop}/>
          <Button variant="contained" onClick={props.backToStudy}>Back to Study</Button>
      </Fragment> : "" }

      {(props.status === 8) ?
      <Fragment>
          <Button variant="contained" onClick={props.resumeBreak}>Resume</Button>
          <Button variant="contained" onClick={props.backToStudy}>Back to Study</Button>
      </Fragment> : "" }

      {(props.status === 9) ?
      <Fragment>
          <Button variant="contained" onClick={props.addBreak}>+</Button>
          <Button variant="contained" onClick={props.subBreak}>-</Button>
          <Button variant="contained" onClick={props.backFromConfig}>Save</Button>
      </Fragment> : "" }

    </div>
  )
}


export default Buttons
